import './watchedcard.css';
import React from 'react'

const WatchedCard = ({movie}) => {
  return (
    <div className='Watched-Card'>
      <img src={movie.Poster} alt="" />
      <h2>{movie.Title}</h2>
      <div className="contorls-btns">

      </div>
    </div>

  )
}

export default WatchedCard
